import styled from 'styled-components';

export const Container = styled.div
`
    width: 100%;
    height: 50px;
    background: #20295F;
    border-top: 5px solid #EE6B26;

    position: fixed;
    bottom: 0;
    display: flex;
    align-items: center;
    justify-content

    span {
        color: #fff;
    }
`
